(5,	'The Boys',	2019,	'18+',	8.7,	95,	'A group of vigilantes known informally as “The Boys” set out to take down corrupt superheroes with no more than blue-collar grit and a willingness to fight dirty.The Boys featuring Karl Urban and Jack Quaid has one or more episodes streaming with subscription on Prime Video  and available for purchase on VUDU. It''''s an action & adventure and comedy show with 12 episodes over 2 seasons. The Boys has a new episode airing on September 17th  2020 (PDT). It has a high IMDb audience rating of 8.7 (170 705 votes) and was very well received by critics.',	2,	NULL),
(112,	'Normal People',	2020,	'16+',	8.6,	86,	'Marianne and Connell weave in and out of each other’s lives in this exploration of sex  power and the desire to love and be loved. Adaptation of Sally Rooney’s best-selling novel.Normal People featuring Daisy Edgar-Jones and Paul Mescal has one or more episodes streaming with subscription on Hulu. It''''s a comedy and drama show with 12 episodes over 1 season. Normal People is no longer running and has no plans to air new episodes or seasons. It has a high IMDb audience rating of 8.6 (25 651 votes) and was very well received by critics.',	1,	NULL),
(45,	'Shameless',	2011,	'18+',	8.6,	90,	'Chicagoan Frank Gallagher is the proud single dad of six smart  industrious  independent kids  who without him would be... perhaps better off. When Frank''''s not at the bar spending what little money they have  he''''s passed out on the floor. But the kids have found ways to grow up in spite of him. They may not be like any family you know  but they make no apologies for being exactly who they are.Shameless featuring William H. Macy and Jeremy Allen White has one or more episodes streaming with subscription on Netflix  streaming on Showtime  streaming with subscription on fuboTV  and 6 others. It''''s a comedy and drama show with 122 episodes over 10 seasons. Shameless is still airing with no announced date for the next episode or season. It has a high IMDb audience rating of 8.6 (193 759 votes) and was well received by critics.',	10,	NULL),
(47,	'Modern Family',	2009,	'16+',	8.4,	90,	'The Pritchett-Dunphy-Tucker clan is a wonderfully large and blended family. They give us an honest and often hilarious look into the sometimes warm  sometimes twisted  embrace of the modern family.Modern Family featuring Ed O''''Neill and Sofía Vergara has one or more episodes streaming with subscription on Hulu  streaming via tv everywhere with ABC (Via Cable/Satellite Provider)  free on ABC  and 5 others. It''''s a comedy and drama show with 255 episodes over 11 seasons. Modern Family is no longer running and has no plans to air new episodes or seasons. It has a high IMDb audience rating of 8.4 (339 700 votes) and was well received by critics.',	11,	NULL),
(70,	'Fleabag',	2016,	'18+',	8.7,	88,	'Fleabag is thrown roughly up against the walls of contemporary London  sleeping with anyone who dares to stand too close  squeezing money from wherever she  can  rejecting anyone who tries to help her  and keeping up her bravado throughout.Fleabag featuring Phoebe Waller-Bridge and Sian Clifford has one or more episodes streaming with subscription on Prime Video  and available for purchase on iTunes. It''''s a comedy and drama show with 12 episodes over 2 seasons. Fleabag is no longer running and has no plans to air new episodes or seasons. It has a high IMDb audience rating of 8.7 (84 330 votes) and was very well received by critics.',	2,	NULL),
(99,	'Big Little Lies',	2017,	'18+',	8.5,	87,	'The tale of three mothers of first graders whose apparently perfect lives unravel to the point of murder.Big Little Lies featuring Nicole Kidman and Reese Witherspoon has one or more episodes streaming with subscription on HBO MAX  streaming on HBO  available for purchase on iTunes  and 4 others. It''''s a comedy and crime show with 14 episodes over 2 seasons. Big Little Lies is no longer running and has no plans to air new episodes or seasons. It has a high IMDb audience rating of 8.5 (145 406 votes) and was very well received by critics.',	2,	NULL),
(90,	'The X-Files',	1993,	'16+',	8.6,	87,	'The exploits of FBI Special Agents Fox Mulder and Dana Scully who investigate X-Files: marginalized  unsolved cases involving paranormal phenomena. Mulder believes in the existence of aliens and the paranormal while Scully  a skeptic  is assigned to make scientific analyses of Mulder''''s discoveries that debunk Mulder''''s work and thus return him to mainstream cases.The X-Files featuring Gillian Anderson and David Duchovny has one or more episodes streaming with subscription on Hulu  streaming via tv everywhere with BBC America (Via Cable/Satellite Provider)  free on FOX  and 7 others. It''''s a drama and fantasy show with 219 episodes over 11 seasons. The X-Files is no longer running and has no plans to air new episodes or seasons. It has a high IMDb audience rating of 8.6 (194 182 votes) and was well received by critics.',	11,	NULL),
(92,	'Justified',	2010,	'18+',	8.6,	87,	'A character drama based on the 2001 Elmore Leonard short story ''''Fire in the Hole.'''' Leonard''''s tale centers around U.S. Marshal Raylan Givens of Kentucky  a quiet but strong-willed official of the law. The tale covers his high-stakes job  as well as his strained relationships with his ex-wife and father.Justified featuring Timothy Olyphant and Walton Goggins has one or more episodes streaming with subscription on Hulu  available for purchase on iTunes  available for purchase on Google Play  and 2 others. It''''s an action & adventure and comedy show with 78 episodes over 6 seasons. Justified is no longer running and has no plans to air new episodes or seasons. It has a high IMDb audience rating of 8.6 (83 711 votes) and was very well received by critics.',	6,	NULL),
(93,	'The Americans',	2013,	'18+',	8.4,	87,	'Set during the Cold War period in the 1980s  The Americans is the story of Elizabeth and Philip Jennings  two Soviet KGB officers posing as an American married couple in the suburbs of Washington D.C. and their neighbor  Stan Beeman  an FBI Counterintelligence agent.The Americans featuring Keri Russell and Matthew Rhys has one or more episodes streaming with subscription on Prime Video  available for purchase on iTunes  available for purchase on Google Play  and 4 others. It''''s an action & adventure and crime show with 75 episodes over 6 seasons. The Americans is no longer running and has no plans to air new episodes or seasons. It has a high IMDb audience rating of 8.4 (80 394 votes) and was very well received by critics.',	6,	NULL),
(108,	'Batman: The Animated Series',	1992,	'7+',	9,	86,	'Batman: The Animated Series is an American animated television series based on the DC Comics superhero Batman. The series was widely praised for its thematic complexity  dark tone  artistic quality  and faithfulness to its title character''''s crime-fighting origins.Batman: The Animated Series featuring Kevin Conroy and Efrem Zimbalist Jr. has one or more episodes streaming with subscription on DC Universe  available for purchase on iTunes  available for purchase on Google Play  and 4 others. It''''s an action & adventure and animation show with 114 episodes over 5 seasons. Batman: The Animated Series is no longer running and has no plans to air new episodes or seasons. It has a high IMDb audience rating of 9.0 (84 276 votes) and was very well received by critics.',	5,	NULL),
