(122,	'24',	2001,	'16+',	8.3,	86,	'24 is an American television series produced for the Fox network and syndicated worldwide  starring Kiefer Sutherland as Counter Terrorist Unit agent Jack Bauer. Each 24-episode season covers 24 hours in the life of Bauer  using the real time method of narration.24 featuring Kiefer Sutherland and Mary Lynn Rajskub has one or more episodes streaming with subscription on Hulu  available for purchase on iTunes  available for purchase on Google Play  and 4 others. It''''s an action & adventure and crime show with 205 episodes over 9 seasons. 24 is no longer running and has no plans to air new episodes or seasons. It has a high IMDb audience rating of 8.3 (168 700 votes) and was well received by critics.',	9,	NULL),
