(155,	'Doom Patrol',	2019,	'18+',	8,	84,	'The Doom Patrol’s members each suffered horrible accidents that gave them superhuman abilities — but also left them scarred and disfigured. Traumatized and downtrodden  the team found purpose through The Chief  who brought them together to investigate the weirdest phenomena in existence — and to protect Earth from what they find.Doom Patrol featuring Diane Guerrero and April Bowlby has one or more episodes streaming with subscription on HBO MAX  streaming with subscription on DC Universe  available for purchase on Google Play  and 2 others. It''''s an action & adventure and comedy show with 24 episodes over 2 seasons. Doom Patrol is still airing with no announced date for the next episode or season. It has a high IMDb audience rating of 8.0 (30 261 votes) and was very well received by critics.',	2,	NULL),
(168,	'Teen Wolf',	2011,	'16+',	7.6,	84,	'Scott McCall  a high school student living in the town of Beacon Hills has his life drastically changed when he''''s bitten by a werewolf  becoming one himself. He must henceforth learn to balance his problematic new identity with his day-to-day teenage life. The following characters are instrumental to his struggle: Stiles  his best friend; Allison  his love interest who comes from a family of werewolf hunters; and Derek  a mysterious werewolf with a dark past. Throughout the series  he strives to keep his loved ones safe while maintaining normal relationships with them.Teen Wolf featuring Tyler Posey and Dylan O''''Brien has one or more episodes streaming with subscription on Prime Video  available for purchase on iTunes  available for purchase on Google Play  and 3 others. It''''s an action & adventure and comedy show with 100 episodes over 6 seasons. Teen Wolf is no longer running and has no plans to air new episodes or seasons. It has a high IMDb audience rating of 7.6 (122 603 votes) and was well received by critics.',	6,	NULL),
(177,	'The Good Wife',	2009,	'16+',	8.3,	84,	'Alicia Florrick boldly assumes full responsibility for her family and re-enters the workforce after her husband''''s very public sex and political corruption scandal lands him in jail.The Good Wife featuring Julianna Margulies and Matt Czuchry has one or more episodes streaming with subscription on Prime Video  streaming on CBS All Access  available for purchase on iTunes  and 4 others. It''''s a crime and drama show with 158 episodes over 7 seasons. The Good Wife is no longer running and has no plans to air new episodes or seasons. It has a high IMDb audience rating of 8.3 (66 886 votes) and was very well received by critics.',	7,	NULL),
