(258,	'Smallville',	2001,	'7+',	7.5,	81,	'The origins of the world’s greatest hero–from Krypton refugee Kal-el’s arrival on Earth through his tumultuous teen years to Clark Kent’s final steps toward embracing his destiny as the Man of Steel.Smallville featuring Tom Welling and Cassidy Freeman has one or more episodes streaming with subscription on Hulu  available for purchase on iTunes  available for purchase on Google Play  and 4 others. It''''s an action & adventure and drama show with 223 episodes over 10 seasons. Smallville is no longer running and has no plans to air new episodes or seasons. It has a better than average IMDb audience rating of 7.5 (114 203 votes) and was well received by critics.',	10,	NULL),
(261,	'The Vietnam War',	2017,	'18+',	9.1,	81,	'An immersive 360-degree narrative telling the epic story of the Vietnam War as it has never before been told on film. Featuring testimony from nearly 80 witnesses  including many Americans who fought in the war and others who opposed it  as well as Vietnamese combatants and civilians from both the winning and losing sides.The Vietnam War featuring Peter Coyote has one or more episodes streaming with subscription on Netflix  streaming with subscription on Hoopla  available for purchase on iTunes  and 4 others. It''''s a documentary and history show with 11 episodes over 1 season. The Vietnam War is no longer running and has no plans to air new episodes or seasons. It has a very high IMDb audience rating of 9.1 (18 953 votes) and was very well received by critics.',	1,	NULL),
(264,	'His Dark Materials',	2019,	'16+',	7.9,	81,	'Lyra is an orphan who lives in a parallel universe in which science  theology and magic are entwined. Lyra''''s search for a kidnapped friend uncovers a sinister plot involving stolen children  and turns into a quest to understand a mysterious phenomenon called Dust. She is later joined on her journey by Will  a boy who possesses a knife that can cut windows between worlds. As Lyra learns the truth about her parents and her prophesied destiny  the two young people are caught up in a war against celestial powers that ranges across many worlds.His Dark Materials featuring Dafne Keen and Ruth Wilson has one or more episodes streaming with subscription on HBO MAX  streaming on HBO  available for purchase on Google Play  and 3 others. It''''s an action & adventure and drama show with 8 episodes over 1 season. His Dark Materials is still airing with no announced date for the next episode or season. It has a high IMDb audience rating of 7.9 (38 120 votes) and was well received by critics.',	1,	NULL),
(271,	'Sneaky Pete',	2015,	'18+',	8.1,	81,	'A con man on the run from a vicious gangster takes cover from his past by assuming the identity of his prison cellmate  Pete  “reuniting” with Pete’s estranged family  a colorful  dysfunctional group that threatens to drag him into a world just as dangerous as the one he’s trying to escape - and  just maybe  give him a taste of the loving family he’s never had.Sneaky Pete featuring Giovanni Ribisi and Marin Ireland has one or more episodes streaming with subscription on Prime Video  available for purchase on iTunes  available for purchase on Google Play  and 2 others. It''''s a crime and drama show with 30 episodes over 3 seasons. Sneaky Pete is no longer running and has no plans to air new episodes or seasons. It has a high IMDb audience rating of 8.1 (28 545 votes) and was very well received by critics.',	3,	NULL),
(283,	'RuPaul''''s Drag Race',	2009,	'16+',	8.5,	81,	'Join RuPaul  the world''''s most famous drag queen  as the host  mentor and judge for the ultimate in drag queen competitions. The top drag queens in the U.S. will vie for drag stardom as RuPaul  in full glamazon drag  will reign supreme in all judging and eliminations while helping guide the contestants as they prepare for each challenge.RuPaul''''s Drag Race featuring RuPaul and Michelle Visage has one or more episodes streaming with subscription on Prime Video  streaming with subscription on Hulu  streaming on CBS All Access  and 8 others. It''''s a game show and LGBTQ show with 175 episodes over 12 seasons. RuPaul''''s Drag Race is still airing with no announced date for the next episode or season. It has a high IMDb audience rating of 8.5 (14 320 votes) and was well received by critics.',	12,	NULL),
(304,	'Borgen',	2010,	'18+',	8.5,	80,	'40-year old political leader Birgitte Nyborg secures her party a landslide victory through her idealism and huge effort  then faces the biggest challenge of her life: how most effectively to use the newly won seats  and how far she is willing to go in order to gain as much influence as possible.Borgen featuring Sidse Babett Knudsen and Pilou Asbæk has one or more episodes streaming with subscription on Netflix  and streaming with subscription on Hoopla. It''''s a drama show with 30 episodes over 3 seasons. Borgen is no longer running and has no plans to air new episodes or seasons. It has a high IMDb audience rating of 8.5 (16 801 votes) and was very well received by critics.',	3,	NULL),
