(339,	'Cowboy Bebop',	1998,	'18+',	8.9,	80,	'In 2071  roughly fifty years after an accident with a hyperspace gateway made the Earth almost uninhabitable  humanity has colonized most of the rocky planets and moons of the Solar System. Amid a rising crime rate  the Inter Solar System Police (ISSP) set up a legalized contract system  in which registered bounty hunters (also referred to as ''''Cowboys'''') chase criminals and bring them in alive in return for a reward.Cowboy Bebop featuring Kouichi Yamadera and Unsho Ishizuka has one or more episodes streaming with subscription on Hulu  free on Adult Swim  free on Tubi  and 6 others. It''''s an action & adventure and animation show with 26 episodes over 1 season. Cowboy Bebop is no longer running and has no plans to air new episodes or seasons. It has a high IMDb audience rating of 8.9 (85 408 votes).',	1,	NULL),
