(342,	'Flight of the Conchords',	2007,	'16+',	8.5,	80,	'The trials and tribulations of a two man  digi-folk band who have moved from New Zealand to New York in the hope of forging a successful music career. So far they''''ve managed to find a manager (whose ''''other'''' job is at the New Zealand Consulate)  one fan (a married obsessive) and one friend (who owns the local pawn shop) -- but not much else.Flight of the Conchords featuring Bret McKenzie and Jemaine Clement has one or more episodes streaming with subscription on HBO MAX  streaming on HBO  available for purchase on iTunes  and 5 others. It''''s a comedy and musical show with 22 episodes over 2 seasons. Flight of the Conchords is no longer running and has no plans to air new episodes or seasons. It has a high IMDb audience rating of 8.5 (54 105 votes) and was very well received by critics.',	2,	NULL),
(349,	'Samurai Champloo',	2004,	'18+',	8.5,	80,	'Mugen is a ferocious  animalistic warrior with a fighting style inspired by break-dancing. Jin is a ronin samurai  who wanders the countryside  alone. They may not be friends  but their paths continually cross. And  when ditzy waitress Fuu gets them out of hot water with the local  magistrate  they agree to join her search for the ''''samurai who smells of sunflowers.''''Samurai Champloo featuring Ayako Kawasumi and Kazuya Nakai has one or more episodes streaming with subscription on Hulu  streaming with subscription on Funimation  available for purchase on iTunes  and 3 others. It''''s an action & adventure and animation show with 26 episodes over 1 season. Samurai Champloo is no longer running and has no plans to air new episodes or seasons. It has a high IMDb audience rating of 8.5 (38 979 votes) and was well received by critics.',	1,	NULL),
