(2318,	'Infinite Stratos',	2011,	'18+',	6.7,	62,	'In the near future  a Japanese scientist engineers a powered exoskeleton called ''''Infinite Stratos'''' (IS). Possessing technology and combat capabilities surpassing those of any other arms system  the IS threatens to destabilize the world. Faced with such an overpowered weapon  the nations of the world enact the ''''Alaska Treaty''''  which states that IS shall never be used for militant combat  and that existing IS technology must be equally distributed to all nations  to prevent any one nation from dominating the others. The introduction of the IS does  however  have a major effect on society. As IS can only be operated by women  there is a shift in the power balance between men and women  where women now dominate society over men. Ten years after the IS was initially introduced  the world has entered a new age of peace. The peace is shattered  however  by Ichika Orimura  a 15-year-old Japanese boy. In a coincidental run-in with a (hibernating) IS suit  it is revealed that he possesses the innate ability to operate an IS. Realizing the potential  the Japanese government forces the bewildered young man to attend the prestigious Infinite Stratos Academy  a multicultural academy where IS pilots from all over the world are trained. Thus  he starts a busy high school life surrounded by girls training to pilot IS.Infinite Stratos has one or more episodes streaming with subscription on Hulu  free on Crunchyroll  free on Tubi  and 3 others. It''''s an action & adventure and animation show with 25 episodes over 2 seasons. Infinite Stratos is no longer running and has no plans to air new episodes or seasons. It has a better than average IMDb audience rating of 6.7 (1 427 votes).',	2,	NULL),
