(2639,	'Maverick',	1957,	NULL,	8,	60,	'Maverick is an American Western television series with comedic overtones created by Roy Huggins. The show ran from September 22  1957 to July 8  1962 on ABC and stars James Garner as Bret Maverick  an adroitly articulate cardsharp. Eight episodes into the first season  he was joined by Jack Kelly as his brother Bart  and from that point on  Garner and Kelly alternated leads from week to week  sometimes teaming up for the occasional two-brother episode. The Mavericks were poker players from Texas who traveled all over the American Old West and on Mississippi riverboats  constantly getting into and out of life-threatening trouble of one sort or another  usually involving money  women  or both. They would typically find themselves weighing a financial windfall against a moral dilemma. More often than not  their consciences trumped their wallets since both Mavericks were intensely ethical. When Garner left the series after the third season due to a legal dispute  Roger Moore was added to the cast as their cousin Beau Maverick. Robert Colbert appeared later in the fourth season as a third Maverick brother  Brent Maverick. No more than two of the series leads ever appeared together in the same episode  and usually only one.Maverick featuring Jack Kelly and James Garner has one or more episodes available for purchase on iTunes  available for purchase on Google Play  available for purchase on Prime Video  and 1 other. It''''s an action & adventure and comedy show with 124 episodes over 5 seasons. Maverick is no longer running and has no plans to air new episodes or seasons. It has a high IMDb audience rating of 8.0 (2 505 votes).',	5,	NULL),
