(7349,	'Good Morning America',	1975,	'all',	4.6,	42,	'Good Morning America is an American morning television show on the ABC television network. It debuted on November 3  1975  and first expanded to weekends with the debut of a Sunday edition on January 3  1993  the Sunday edition was later cancelled in 1999 with weekend editions returning on both Saturdays and Sundays on September 4  2004. The weekday program airs from 7 to 9 a.m. in all U.S. time zones; the weekend edition is one hour long. A third hour of the weekday broadcast aired from 2007 to 2008  exclusively on ABC News Now.The program features news  interviews  weather foreasts  special-interest stories  and feature segments such as ''''Pop News'''' and ''''Play of the Day''''. It is produced by ABC News and broadcasts from the Times Square Studios in New York City''''s Times Square district. The current primary anchors are Robin Roberts and George Stephanopoulos  along with newsreader Josh Elliott  weather anchor Sam Champion and lifestyle anchor Lara Spencer.Good Morning America has generally run second in the ratings to NBC''''s Today since 1995. It overtook its rival for a period from the early to mid-1980s with anchors David Hartman and Joan Lunden  from the late 1980s to the mid-1990s with Charles Gibson and Lunden  and in April 2012 with Roberts and Stephanopoulos. The program has recently started to dominate over its competitors and in August 2013  it celebrated 52 consecutive weeks as the top-rated network morning news program.Good Morning America featuring Emily Blunt and Scarlett Johansson has one or more episodes streaming with subscription on Hulu  and streaming via tv everywhere with ABC (Via Cable/Satellite Provider). It has 374 episodes over 12 seasons. Good Morning America is still airing with no announced date for the next episode or season. It has a less than average IMDb audience rating of 4.6 (1 269 votes).',	12,	NULL),
