(10147,	'Power Battle Watch Car',	2016,	NULL,	NULL,	26,	'Jino and his Watch Car  Bluewill  compete in the Battle League to become world champions. Meanwhile  a dark force threatens to destroy them all.Power Battle Watch Car has one or more episodes streaming with subscription on Prime Video  free on Tubi  and available for purchase on Prime Video. It has 52 episodes over 1 season. Power Battle Watch Car is still airing with no announced date for the next episode or season.',	1,	'2017-06-01'),
(10308,	'Zombie Dumb',	2016,	'7+',	5,	24,	'The zombie epidemic  which all of us are so scared on TV  yet occurred. Gradually people did not become. Zombies have gone to live in a dungeon  where there is no sunlight - there they are better. Over time  they remembered that they were once human beings. They built schools and began to develop. Zombiwill is an ordinary town  like many in a dungeon. There lives a lot of kids who do not sit still. Their favorite occupation is to play things that once belonged to people.Zombie Dumb has one or more episodes streaming with subscription on Netflix. It''''s an action & adventure and animation show with 28 episodes over 2 seasons. Zombie Dumb is still airing with no announced date for the next episode or season. It has a less than average IMDb audience rating of 5.0 (7 votes).',	2,	'2019-07-01'),
(10348,	'My Hotter Half',	2017,	NULL,	3.9,	24,	'It''''s partner versus partner  as couples compete to make the most smoking selfie in this explosive  nerve-jangling battle of hotness.My Hotter Half has one or more episodes streaming with subscription on Netflix. It has 20 episodes over 1 season. My Hotter Half is still airing with no announced date for the next episode or season. It has a low IMDb audience rating of 3.9 (170 votes).',	1,	'2019-07-22'),
(10363,	'President',	2010,	NULL,	7.2,	24,	'President is a South Korean television series starring real-life married couple Choi Soo-jong and Ha Hee-ra as Korea''''s president and his first lady. This is their first acting collaboration. It aired on KBS2 from December 15  2010 to February 24  2011 on Wednesdays and Thursdays at 21:05 for 24 episodes.President featuring Choi Soo-jong and Lee Sung-min has one or more episodes streaming with subscription on Netflix. It''''s a drama show with 20 episodes over 1 season. President is no longer running and has no plans to air new episodes or seasons. It has a better than average IMDb audience rating of 7.2 (13 votes).',	1,	'2017-04-28'),
(10373,	'Game Winning Hit',	2009,	NULL,	1.9,	23,	'Game Winning Hit has one or more episodes streaming with subscription on Netflix. It''''s a drama and sport show with 40 episodes over 1 season. Game Winning Hit is still airing with no announced date for the next episode or season. It has a very low IMDb audience rating of 1.9 (54 votes).',	1,	'2016-09-01'),
(10811,	'Sleepless Society: Bedtime Wishes',	2019,	NULL,	NULL,	16,	'During a holiday stay at a hotel resort  a flight attendant encounters a wealthy  mysterious man with two different personas.Sleepless Society: Bedtime Wishes featuring Pinky Savika Chaiyadej and Krit Shahkrit Yamnam has one or more episodes streaming with subscription on Netflix. It''''s a crime and drama show with 13 episodes over 1 season. Sleepless Society: Bedtime Wishes is no longer running and has no plans to air new episodes or seasons.',	1,	'2019-10-31'),
(10396,	'The Ultimatum',	2009,	NULL,	NULL,	23,	'The Ultimatum is a Singaporean Chinese drama which was telecasted on Singapore''''s free-to-air channel  MediaCorp Channel 8. It made its debut on 27 May 2009 and ended on the date 7 July 2009. This drama serial consists of 30 episodes  and was screened on every weekday night at 9:00 pm. Being the mid-year Channel 8 blockbuster of 2009  it was the first Channel 8 drama to be fully filmed in HD.Despite being touted as the 2009 blockbuster of the year and featuring many established actors and actresses like Zoe Tay  Li Nanxing and Fann Wong  the show''''s reception was lukewarm at best. Many viewers faulted the serial for improbable casting and for a lack of originality in certain parts of the scripting. The series also came under harsh criticism for being overly melodramatic. However  the performance of newcomers such as Jerry Yeo  who played an antagonist for the first time  were widely praised.The Ultimatum has one or more episodes streaming with subscription on Netflix  and free on Crunchyroll. It''''s a drama show with 30 episodes over 1 season. The Ultimatum is no longer running and has no plans to air new episodes or seasons.',	1,	'2017-07-01'),
